import React, { Component } from 'react';
import ProfilePic from './profilepic.jpg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App-sections">
        <div className="App-section1">
          <header className="header">
            <p>Vardhan Dugar</p>
          </header>
        </div>
        <div className="App-section2">
          <img src={ProfilePic} />
        </div>
      </div>
    );
  }
}

export default App;
